import './App.css';
import * as React from 'react';
import Map from 'react-map-gl';
import {useState} from 'react';

function App() {
  const [viewport,setViewport]=useState({
  height:400,
  width:400,
  latitude:37.7577,
  logitude:-122.4376,
  zoom:8
  });
  return (
    <div className="App">
     <Map
     {...viewport}
     mapboxApiAccessToken={'pk.eyJ1IjoicmFqZ3VwdGE3NyIsImEiOiJjbDJidXNqbzEwajI0M2twOTJxbmJ4bTUxIn0.S_Xbg9UiZeZUwW5t-zBjhg'}
     onViewportChange={nextViewport=>{
       setViewport(nextViewport);
     }}
     />
    </div>
  );
}

export default App;
